    function buttonDisabled(thatButton) {

        thatButton.prop('disabled', true);
        var loadingText = '<i class=""fa fa-circle-o-notch fa-spin""></i> loading...';
        if (thatButton.html() !== loadingText) {
            thatButton.data('original-text', thatButton.html());
            thatButton.html(loadingText);
        }
        setTimeout(function () {
            thatButton.html(thatButton.data('original-text'));
            thatButton.prop('disabled', false);
        }, 500);
    }
    function newWindow(url, title) {
        const h = screen.height - screen.height / 5;
        const w = screen.width - screen.width / 20;
        var y = window.outerHeight / 2 + window.screenY - (h / 2)
        var x = window.outerWidth / 2 + window.screenX - (w / 2)
        return window.open(url, title, 'toolbar=no, location=no, directories=no, status=no, menubar=no, scrollbars=yes, resizable=yes, copyhistory=no, width=' + w + ', height=' + h + ', top=");
